import { useState } from 'react';
import { CircularProgressbar } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import ChangingProgressProvider from "./ChangingProgressProvider";


export const ProgressBarSkills = (props) => {


  return(
    <div className='CircularProgressbar'>
      <ChangingProgressProvider value={[0, props.percentage ]} >
      <CircularProgressbar 
  value={props.percentage} 
  background={false} 
  swipeable={true}
  draggable={true}
  initialAnimation={true}
  styles={{
    path: {
      // Path color
      stroke: `background: -webkit-linear-gradient(-86deg, #EEF85B 23%, #7AEC8D 53%, #09E5C3 91%);`,
      // Customize transition animation
      transition: 'stroke-dashoffset 5.5s ease 5s',},
      trail: {
        // Trail color
        stroke: '#555',
      },

  }}
  />
  </ChangingProgressProvider>
    </div>
  );
}
